import { Container, Row, Col } from "shards-react";
import BobaTracker from "./components/BobaTracker/BobaTracker.js";

import "./App.css";

function App() {
  return (
    <Container>
      <Row>
        <Col sm={{ size: 8, order: 2, offset: 2 }}>
          .col-sm-8 .order-sm-2 .offset-sm-2
        </Col>
      </Row>
    </Container>
  );
}

export default App;
